import styled from 'styled-components';


export const FooterStyled = styled.div`
    width: 100%;
    height: 5px;
    padding: 50px 25px;
    bottom: -250px;
    position: sticky;
    background-color:Black;
    z-index:100;
    font-size: 15px;
    color: White;
`
